INSERT INTO `fx_article` VALUES (105,'','',0,50,'','',0,9817,'','【#心脏支架价格最大降幅66%#！55家公立医院抱团砍价患者能省多少钱？】今年以来，一系列解决老百姓看病贵的政策措施陆续出台。在江苏省，一些常用的心脏血管支架、起搏器等医用耗材进入了联盟采购名单中。组成联盟的55家三级公立医疗机构，全年冠脉支架和起搏器采购量的70%，用于此次联盟采购。那么，新政策的执行，能让患者的医疗费减少多少呢？淮安秦先生前几日在南京市第一医院安装了4个支架，他表示原来13400元/个的支架，现在7000元/个，四个支架省了20000多元。像秦先生这样得到实惠的，并非个例。经过此次谈判，中选的支架品种价格平均降幅为51.01%，最大降幅66.07%；中选的起搏器品种平均降幅15.86%，最大降幅38.13%。其中包含了进口、国产、高价、低价不同品种。希望让患者得到实惠的同时，也满足临床的应用需求。南京市第一医院副院长吴素玲表示，从10月1日到10日，南京市第一医院大概用了60多个支架，让利大约在40余万元。',0,'','1571019507','1571021123','',1,'','',308,'',1,NULL,NULL,'',NULL,00000000087,00000000024,00000000000,1,'1647333349976083',NULL,0,0,0,0,NULL,'0',0),(106,'','',0,50,'','decd02285f4457766c8f23e690364f6b.jpg',0,3867,'','广西彩礼倒贴？这可能吗？\n刚看到有条友发了个全国彩礼排行榜，广西排尾，是倒贴，我们是不是拖了全国后腿了呀？其它省份是几万，十几万，二十几万，我们居然倒贴！！！！！\n可能吗？可能，非常可能。\n当然，倒贴并不是不用彩礼，主要是两个方面。\n一：彩礼低，很多农村彩礼就几千元，一些县市普遍就一万到二万，这个水平应该算低了。\n二：真证倒贴是嫁妆，送8000彩礼，基本是回一万左右的嫁妆。\n彩礼这么低，是不是也想找个广西姑娘呢？就看您的本事了[呲牙]',0,'','1570889122','1571021127','',1,'','',309,'',2,'[&quot;7ae97b55286012b24c6feef0629b46a5.jpg&quot;]',NULL,'',NULL,00000000296,00000000020,00000000003,1,'1647196631829507',NULL,0,0,0,0,NULL,'0',0),(55,'','',0,50,'','7f7f011830a2791bb7d756e56d2a206c.jpg',0,4340,'','有点悲催，不仅网络卡的不行[灵光一闪]\n还开着直播一直流鼻涕[捂脸][捂脸]\n[捂脸]太难受了',0,'','1570981170','1570991943','',1,'','',155,'',2,'[&quot;32bac2cab87e83de83d6f37fd5773ef6.jpg&quot;,&quot;7f7f011830a2791bb7d756e56d2a206c.jpg&quot;]',NULL,'',NULL,00000000044,00000000015,00000000000,1,'1647293150877707',NULL,0,0,0,0,NULL,'0',0),(56,'','',0,50,'','620db5e198aab8bf29ae526642676b1d.jpg',0,3895,'','如果老公知道自己的孩子不是他的会怎么样？\n\n我结婚5年了，孩子现在4岁了。我发现孩子越长越像前男友，1岁的时候我就觉得像，现在看简直是一个模子刻出来的，因为老公没见过我的前男友，而且人比较大大咧咧，所以根本没怀疑什么。\n\n我在结婚后不久确实和前男友见过一次面，然后那个…我想瞒下去，但是总怕事情败露，事情败露得越晚后果越严重。我现在真的好怕，我到底应该怎么办。老公人很好，我觉得自己对不起他。如果离婚，我是不是要净身出户。\n（网友投稿）#爱情其实很简单# #我要上头条#',0,'','1570848577','1570991944','',1,'','',156,'',2,'[&quot;50216ec49e5732bdc9f56c2f79e2f33a.jpg&quot;]',NULL,'',NULL,00000000092,00000000043,00000000008,1,'1647089068066819',NULL,0,0,0,0,NULL,'0',0),(57,'','',0,50,'','e97b5a89adb87330724d92000e329be1.jpg',0,5482,'','杨颖: “我的努力配得上8000万片酬, 问心无愧”, 张嘉译回复8字\n杨颖一直是个不缺话题的女明星，不管是上跑男，还是结婚生子方面，都有好多负面新闻，早前杨颖又被黑了，这次她有些急眼，采访称你们知道我多努力吗？我的努力配得上8000万片酬, 问心无愧，而老戏骨张嘉译回复8字太给力。\n\n\n其实大部人认识Angelababy（杨颖）应该都是她跟黄晓明结婚之后，在这之前好多人应该都不知道Angelababy是谁，长得很好看，但是演技实在是没眼看。但是人家的老公资源太厉害，baby嫁老公简直就嫁了个金主啊!黄晓明又爱她又宠她，还多次给她接女主的戏，简直是太幸福了!可就是因为这样，baby一直被大家吐槽。\n\n\n小编对杨颖的第一印象，是来自《奔跑吧》，当时这档节目还叫做《奔跑吧兄弟》。这档节目因为节目内容新颖，所以在第一季的时候火的一塌糊涂。也是因为这档节目，带火了跑男兄弟团的好几位明星。在第一季的时候，大概也只有邓超算是大咖，其他人虽然是明星，但是在当时和现在的咖位比起来，真的是差很多。尤其是杨颖，现在和当时比，更是天差地别，在当时几乎很少人认识杨颖。\n\n\n后来她的名气和地位也越来越高，综艺节目真是一个提高知名度的好地方，最顶峰的时候，杨颖的片酬，高达8000万人民币，这个大家也都知道，就是她出演《孤芳不自赏》的时候，就是这个片酬《孤芳不自赏》，耀天死了，何侠死了，楚北捷和白娉婷双宿双飞了...全剧跳跃着看下来，小编一直抱着审视玩味的态度，毕竟有哇爷的颜值和持续不断的抠图、替身争议...万万没想到，本着看热闹的心态却被看哭了两次！！！\n\n\nAngelababy从13年接拍的电视剧已经开始提高了，《寻龙诀》，《狄仁杰之神都龙王》，《黄飞鸿之英雄有梦》，《建党伟业》《狄仁杰之神都龙王》都是非常好的作品。论演技，Angelababy在《寻龙诀》里的表现最出彩，所以在那一年的百花奖颁奖礼上，她成了当之无愧的最佳女配。\n\n\n但是，这部电视剧却成为杨颖这辈子也无法抹去的黑点，因为杨颖在这部电视剧的表现，让很多观众都无法接受。首先，遭人诟病的，也是首当其冲的就是这部电视剧的抠图事件。其实，抠图是很多电视剧经常用的手段，包括《天盛长歌》，虽然好评如潮，但是其中也用了抠图的手段\n\n\n不过好像《孤芳不自赏》中抠图抠的有点丧心病狂了，好像什么场景都是用抠图完成的。你抠图就抠图吧，后期用点心也是可以的啊，大量抠图加上后期的不认真，导致这部电视剧根本就没法看。\n\nbaby之前在接受采访的时候，表示：没有人是完美的，上天给了我这个样貌，我就会得到一些东西。言外之意就是自己有美貌，拿8000万是我应得，问心无愧! 然而拿着高片酬演出的杨颖一直被网友吐槽演技差，而且还在接受采访时回应这些质疑“我的努力配得上8000万片酬，你们只看到我的片酬，却没有看到我在片场背台词的努力!”小编想问一句，哪个演员不背台词啊？\n\n\n而之前，张嘉译在接受采访的时候，也是无意间打了很多小鲜肉的脸，其中也包括杨颖。记者问张嘉译，对于“八千万片酬”这个问题怎么看？张嘉译称：“没办法，我们不红！”这话真的是打脸，而且打的不只是杨颖，而是很多人。\n\n\n身为娱乐圈的老戏骨张嘉译，他说自己为了演戏，每天可以不吃不睡，拍完戏后再苦再累，张嘉译也会把自己的表演在重新看一遍，从而反思自己的表演。在片场，张嘉译非常敬业。如果对自己的表演不满意，张嘉译会向导演提出重新拍摄。然而这些实力派的片酬不足小鲜肉的一半，我真的担心哪天想看电视剧，发现都是这种面无表情的明星在演戏。\n明星人气榜  你今天打卡了吗？点击前面蓝色按钮进入头条官方榜单明星人气榜，把你的10票都投给AngelaBaby把？AngelaBaby有你真幸运！tks。@明星人气榜单',0,'','1570982638','1570991948','',1,'','',165,'',2,'[&quot;b945768068bb57b223879f0d8e7cad07.jpg&quot;,&quot;e97b5a89adb87330724d92000e329be1.jpg&quot;,&quot;2e569b73ed56f05de42945fe2eea275d.jpg&quot;,&quot;a8cb5dfaae8801d68f9df53fd463c0b4.jpg&quot;,&quot;ba9f3e89a7d7b112c6fa8fc77bc1a1e0.jpg&quot;,&quot;284ee2eba1ee7899d09f5fd10b41c2af.jpg&quot;,&quot;b1af948645a607bff08bf83aeda43d22.jpg&quot;,&quot;39ea8d989362bcb93be38e5258ba779f.jpg&quot;]',NULL,'',NULL,00000000421,00000000027,00000000000,1,'1647294690677768',NULL,0,0,0,0,NULL,'0',0),(58,'','',0,50,'','aa3f68a2a4fef92b73a99d009686f63e.jpg',0,7049,'','#龙岩头条# 来武平县一定要去的地方：千鹭湖公园，碧水公园，河滨客家文化公园，武平县马头山公园，文博园，东门苑公园，会正纪念园，绵洋寺，财神庙，等好多好玩的地方，一定要慢慢的游玩。',0,'','1570987651','1570991992','',1,'','',166,'',2,'[&quot;d022dd98ceadbe17a13fb404d3b44b80.jpg&quot;]',NULL,'',NULL,00000000571,00000000034,00000000000,1,'1647299946772487',NULL,0,0,0,0,NULL,'0',0),(59,'','',0,50,'','f311167c46990dda95524e932b5edfe1.jpg',0,754,'','#秋日好时光# 买的带金边的扁豆，比一般的绿扁豆颜色要浅白一些，身量苗条一些，就是不知道吃起来好不好吃。卖菜的老农倒是很善良。',0,'','1570979054','1570991993','',1,'','',167,'',2,'[&quot;05adc0991906eb2886267ea0cbaef3ad.jpg&quot;]',NULL,'',NULL,00000000188,00000000009,00000000001,1,'1647290932257795',NULL,0,0,0,0,NULL,'0',0),(60,'','',0,50,'','46a3b953ddf68cc799d618faf9b41fb2.jpg',0,9649,'','老北京美食，豆汁，胶圈，面茶和烧饼，豆汁那叫一个酸爽，不过，可能有人喝不惯这个酸臭味啊！胶圈嘎嘣脆，面茶回香，素丸子鲜美，我滴天呢，很不错的早餐啊，北京，尹三豆汁，天坛旁边。',0,'','1570939194','1570991994','',1,'','',169,'',2,'[&quot;632127b9e3ec96009b5cd4193ba038ab.jpg&quot;,&quot;46a3b953ddf68cc799d618faf9b41fb2.jpg&quot;]',NULL,'',NULL,00000000443,00000000033,00000000000,1,'1647249135918083',NULL,0,0,0,0,NULL,'0',0),(61,'','',0,50,'','d731d66406c9e2987a905c46943c91c1.jpg',0,3903,'','#警方通报李心草溺亡情况# 19岁女大学生深夜被室友的朋友暴力掌掴，强制猥亵后跳江溺亡，真是让人痛心！女孩子在外面怎样保护自己？哪里才是安全的？许多网友说女孩子半夜三更去酒吧，肯定不是什么好女孩！今天，我们暂且不论女孩去酒吧的对与错，就论人生安全，一个鲜活的生命就这样没了，给家庭造成的伤害和对社会造成的影响，不容忽视！#女孩子安全问题#',0,'','1570927513','1570991995','',1,'','',170,'',2,'[&quot;ae23edf5e69317daf016a8fba6ee2d7e.jpg&quot;]',NULL,'',NULL,00000000337,00000000001,00000000020,1,'1647236887783431',NULL,0,0,0,0,NULL,'0',0),(62,'','',0,50,'','d9a2f7f2ee12431cefac3136c739ff1c.jpg',0,8228,'','#你爱上家乡的理由# 大家好，我是来自百色凌云县的林小兔，[耶]我们这个县城虽小，但是人称小香港[害羞]这里最出名的就是大茶壶，一个茶壶比大巴车还要高还要大，以前读书时经常去那里逛，我最喜欢的还有风雨桥，几个朋友坐上桥上吹吹风，聊聊天，在喝一碗凉虾，太美好了，冬天可以来一碗热腾腾的汤圆[害羞]风雨桥对面拱形的桥就是太平桥，桥下很多夜市，烧烤摊，可以吃到凌云特色烧烤[呲牙]这就是凌云县，空气好，风景好，人更好[呲牙][呲牙]',0,'','1570986667','1570992062','',1,'','',191,'',2,'[&quot;66307bc9295062cc3fc1ea780b041923.jpg&quot;,&quot;d9a2f7f2ee12431cefac3136c739ff1c.jpg&quot;,&quot;d7f7e7a9f1e8379ee56e6c3fe5b506fb.jpg&quot;,&quot;ca8407a5ff1c456a6f7dff2503122e18.jpg&quot;]',NULL,'',NULL,00000000178,00000000005,00000000000,1,'1647298915610635',NULL,0,0,0,0,NULL,'0',0),(99,'','',0,50,'','',0,2309,'','复制这条信息打开【火山小视频】，【怡果果园270】的直播间好精彩，快来看！#Le3JdcMx700# 还没有安装火山小视频？在应用商店搜索【火山小视频】下载应用。',0,'','1571017896','1571021098','',1,'','',287,'',1,NULL,NULL,'',NULL,00000000228,00000000050,00000000000,1,'1647331661673486',NULL,0,0,0,0,NULL,'0',0),(100,'','',0,50,'','810f1a8c81111e4357a6a9754e30e8ce.jpg',0,9927,'','在职场上，领导的这三句话，背后藏着很深的含义\n\n第一句、有问题随时来找我\n当领导的人日理万机，大小会议无数，终日出差，你想在办公室抓个人影都困难，更别说去找他们问问题\n\n第二句、有什么意见直接提出来\n如果你的确对公司政策，流程等有意见，跟谁去提啊？提完之后，是否引起足够重视？有什么后续安排？谁负责将结果反馈给意见提出人？\n\n第三句、我这是对事不对人，你不要多想\n“对事不对人”其实是掩耳盗铃，事情不是由人干出来的吗，所以事做不好，事做错了，做的人肯定是有问题的，这是基本逻辑和常识。\n\n#职场微头条# #每日励志# ',0,'','1571016221','1571021099','',1,'','',288,'',2,'[&quot;be70c113875e1ca462f8fc4ab93e32fd.jpg&quot;]',NULL,'',NULL,00000000444,00000000005,00000000000,1,'1647329904697352',NULL,0,0,0,0,NULL,'0',0),(101,'','',0,50,'','7bb041d40fc3ec9687d73cded772a181.jpg',0,9848,'','“辽宁舰呼叫81192，辽宁舰呼叫81192，前方空域良好，甲板已清空，请着舰，81192收到请回复！”\n“81192收到，我已无法返航，请继续前进，重复，请继续前进！”\n\n致敬英雄，祖国的领土神圣不可侵犯，我们会永远继续前进！——致那些逝去的脊梁！\n人民英雄永垂不朽！\n\n#我要上头条#',0,'','1570850135','1571021103','',1,'','',289,'',2,'[&quot;f02ad2e45caa9aaf8bf5e5f09dd83059.jpg&quot;,&quot;7bb041d40fc3ec9687d73cded772a181.jpg&quot;,&quot;970ff6d71812b3dd6a68b4299fc68ee0.jpg&quot;,&quot;c65d4e83086b3f32f53b4b34794b1018.jpg&quot;,&quot;8deca39bba23d3563c0bee6b96d9ad27.jpg&quot;,&quot;ff6e35f7c126fc259085386700244718.jpg&quot;]',NULL,'',NULL,00000000404,00000000014,00000000015,1,'1647155750949902',NULL,0,0,0,0,NULL,'0',0),(102,'','',0,50,'','215f3b22cceb6bef797b0d360a6588ad.jpg',0,1282,'','#商洛头条##我的家乡在商洛# 洛源龙潭美景',0,'','1571016202','1571021115','',1,'','',305,'',2,'[&quot;647a6b6d9e767df272e390fa0a601914.jpg&quot;,&quot;215f3b22cceb6bef797b0d360a6588ad.jpg&quot;,&quot;b8d4d5085b6af171cc87ec830214655a.jpg&quot;]',NULL,'',NULL,00000000447,00000000034,00000000000,1,'1647329884983309',NULL,0,0,0,0,NULL,'0',0),(103,'','',0,50,'','',0,842,'','1999年退伍定编安置到银行工作，本以为能享受国家的政策，哪知银行决定让我下三产接受锻炼，协助三产清理清产，待三产清理完毕后即可自然回行工作，让我工资在三产领取合同也签署到三产企业，这一清理清产就是七年多。三产清理完毕后资金资产全部划归银行所有，既无安置分流方案也无任何买断，除了社保关系未转移，工资由银行发放了一年一个月，当我要求按原定计划回行工作时却遭到了银行的拒绝，理由竟然是我是三产员工，和银行没有任何关系，虽然话是那么说，工作还得继续干，不干二十年，欠薪断保依然再继续',0,'','1571019869','1571021116','',1,'','',306,'',1,NULL,NULL,'',NULL,00000000164,00000000036,00000000000,1,'1647333730013187',NULL,0,0,0,0,NULL,'0',0),(104,'','',0,50,'','',0,5883,'','吴敬平没有在现场，给冯天薇指导的是原浙江队的何教练。',0,'','1571014128','1571021119','',1,'','',307,'',1,NULL,NULL,'',NULL,00000000502,00000000043,00000000000,1,'1647327710572552',NULL,0,0,0,0,NULL,'0',0),(79,'','',0,50,'','f172634eac6070b408292db6fe2847d7.jpg',0,3486,'','最鲜明的对比莫过于娱乐圈的大s和小s了，两个人是亲姐妹，一同嫁入了豪门。\n\n生活却是天壤地别，大s怀孕，汪小菲为她忙前忙后，悉心照料，她也为老公生下了一个又一个的孩子。\n\n重回荧幕前，却活的少女感十足，丝毫看不出她已经是三个孩子的妈妈了，话里话外都离不开她的老公，可见夫妻两人之间的感情深厚。\n\n反观小s，放弃身材为老公生娃，老公却被爆出背叛和家暴的问题，一度崩溃大哭，这样的生活有多糟心？\n\n当大小s站在一起的时候就能看出来了，作为姐姐活的少女感十足，而妹妹的脸上尽显沧桑，可见一个男人爱不爱你，对你容貌有多么大的影响，同时也可以作为一个直观的检测标准来判断。#情感咨询室# #情感# ',0,'','1571017537','1571020993','',1,'','',265,'',2,'[&quot;7ab73db5184b1e8c71e15cff454cf540.jpg&quot;]',NULL,'',NULL,00000000101,00000000036,00000000001,1,'1647331284289544',NULL,0,0,0,0,NULL,'0',0),(80,'','',0,50,'','15067cb7c5641d4559963e6458c70cb5.jpg',0,4495,'','客厅里一直挂着这幅画，非常喜欢领导人笑着的样子，因为他们笑着，我们就安心。\n#我要上头条# #周恩来# #红色血脉#',0,'','1571016373','1571020997','',1,'','',267,'',2,'[&quot;8e0576c832c015c8bd899a61370bcb36.jpg&quot;,&quot;15067cb7c5641d4559963e6458c70cb5.jpg&quot;]',NULL,'',NULL,00000000527,00000000028,00000000000,1,'1647330064240652',NULL,0,0,0,0,NULL,'0',0),(81,'','',0,50,'','5b4fc12146efe0463e2017a1a1e758b8.jpg',0,3997,'','【明道禅心】-72：还有被宝剑逼悟的高僧？！',0,'','1571007625','1571020999','',1,'','',268,'',2,'[&quot;0ad47857e81b62c5260747d8dd44878a.jpg&quot;]',NULL,'',NULL,00000000348,00000000009,00000000000,1,'1647320890496003',NULL,0,0,0,0,NULL,'0',0),(82,'','',0,50,'','b45fa53193a81e07f437578cfb633232.jpg',0,9362,'','开自动档的车在下坡的时候，挂D档踩刹车最危险，过来了解下怎样操作才安全\n\n\n如今汽车已经彻底融入到了人们的生活当中，如果没有了汽车相信会变得很不方便，汽车发展到现在也是有着很长的年头了。一二十年前路上跑的汽车手动挡较多，但现在路上跑的汽车可以说满大街都是自动挡的汽车。开自动挡的汽车虽说是简单很多，但是很多车主都在使用的时候出现一些操作性的错误，就比如自动挡汽车如何下坡这点。很多人都不知道挂D挡踩刹车最危险，老司机表示：想保命就这样做！\n\n自动挡的汽车虽然都是电脑控制行车档位，但在一些情况下也是需要车主们十分注意的，而开自动挡汽车在下坡的时候老司机直言最不该做的就是挂D挡踩刹车。因为驾驶自动挡汽车下坡的时候，急刹车可能会导致刹车失灵，如果是连续的下坡路段，长时间踩刹车很容易导致刹车盘温度升高导致制动效果减弱！\n\n老司机直言开自动挡汽车正确的下坡做法就是挂入L档位行驶，因为L档是低速档位，作用就是利用发动机制动达到减速效果，让车辆在下坡的时候能够更好的控制车速。如果没有L挡也可以选择挂入M档位，手动把档位调制抵挡行驶。而且在刹车的时候可别一直踩，正确的方式应该是用点刹的方式，所以说不想让刹车的时候因为高温失灵造成事故，就按照这样方式做！\n\n不过在开车的时候需要注意的不仅仅如果下破，在日常生活中也是需要十分注意的，毕竟现在人多车多意外随时都有可能发生。而且现在很多车主都对盲区这个问题不以为然，等到发生剐蹭事故了之后也都会后悔自己没有观察到位。\n\n不过车主们如果想要解决盲区这一个问题其实也很简单，有钱的可以换上带盲区探测的车辆，如果没有条件那么就买上一个小圆镜安装在后视镜上面！\n\n这个小圆镜如今很多车主都会选择安装，为的就是用它来减少盲区，它的价钱不贵也就是十几块钱，装在汽车的后视镜上面能够有效的增大行车时候的安全。不管是转弯还是变道超车都是有着很大的帮助，虽然车辆上面没有盲区探测没有360全景摄像头，但是安装上小圆镜能够大大的解决盲区问题，无疑是辅助行车的最佳之选！',0,'','1571019480','1571020999','',1,'','',269,'',2,'[&quot;d088dcb0dafadb70ac7a75bcc89beb16.jpg&quot;]',NULL,'',NULL,00000000560,00000000004,00000000000,1,'1647333322329092',NULL,0,0,0,0,NULL,'0',0),(83,'','',0,50,'','',0,3670,'','昨天去给大宝送眼镜，正走着，旁边的机动车都停了，后面的车一个劲儿按喇叭，前面的车纹丝不动。我骑的电动车，走到路口也没看到有什么特殊情况。稍一停顿，一个腿脚不便的残疾人从车头那里出来了，他正挪着腿过马路。他的两条腿都很短，发育不良的那种，挪一步也就十多公分，可想这个宽大的路口他走了多久。我想说，感谢耐心等待的所有司机师傅们，[玫瑰]。人很多，怕阻挡别人行走，我没有停下拍照。[微笑]',0,'','1571017901','1571021000','',1,'','',270,'',1,NULL,NULL,'',NULL,00000000140,00000000003,00000000000,1,'1647331666591747',NULL,0,0,0,0,NULL,'0',0),(84,'','',0,50,'','01ea097c6eb8f61d9d4394548127fe79.jpg',0,2399,'','第一次做这个，还不知道会怎么样！',0,'','1570988042','1571021007','',1,'','',271,'',2,'[&quot;e9765e34baefd1260d67a1e5f38f4eb3.jpg&quot;,&quot;01ea097c6eb8f61d9d4394548127fe79.jpg&quot;]',NULL,'',NULL,00000000559,00000000024,00000000000,1,'1647300357372931',NULL,0,0,0,0,NULL,'0',0),(85,'','',0,50,'','',0,5194,'','长沙家里催婚怎么办？办一个单身派对或者私人派对吧\n家里催婚怎么办？想要告别单身？\n1.提升自我。那就是自己是否已经足够优秀。\n2.多参加朋友聚会。不要一有时间就回家打游戏，多参加社交活动，去威廉古堡别墅轰趴来一场单身趴，心动就在今晚。\n3.多利用社交软件。现在社交软件非常多，各有各的特色。.\n4.让朋友和亲戚介绍。身边的朋友都很了解你，也会选择满足你条件...\n5.参加相亲。如今不只传统相亲，还有各种网络平台和电视相亲节目。\n\n\n\n\n嘘~~~他想在长沙闺蜜聚会上给你最浪漫的求婚表白\n长沙闺蜜聚会上，他想给你最浪漫的求婚表白',0,'','1571019903','1571021008','',1,'','',272,'',1,NULL,NULL,'',NULL,00000000039,00000000033,00000000000,1,'1647333765434382',NULL,0,0,0,0,NULL,'0',0),(86,'','',0,50,'','2a9c698cdb93835f04bed83abda9d40b.jpg',0,3931,'','本人结婚五年了，属于相亲闪婚，结婚头一年没有要孩子第二年要了，在老婆怀孕初期间和她闺蜜发生过一次关系，她闺蜜属于哪种攀比心理发生的关系就一次从那以后没有在发生过什么，一个月左右吧她闺蜜也就出去了，然后就很少跟我们联系了，只有借钱的时候找我中间借了几万块钱，也管我老婆那里借了几万块钱，对于借钱给他我和我老婆真是每次都给她，由于日子过得去也就没有问她要过，但是前段她回来老家了带着我的孩子，现在孩子都三岁了，现在老婆跟我分居她在她店里面一个礼拜回家一两天，我现在真的不知道怎么办了，那个孩子我想要回来，我跟我老婆我们俩个一儿一女，我该怎么去和老婆解释，对于老婆现在这么多年了也真的是同甘共苦过来的有很深的感情了，但是对于她闺蜜我真的不知道怎么去面对，孩子该不该要过来我来扶养，或者是我经常给她点钱，不知道怎么办了，所谓当局者迷旁观者清朋友们给个建议吧，只想听听建议，别骂错已经成型！\n                                                                                      ------------日本久紧，求关注',0,'','1571019927','1571021008','',1,'','',273,'',2,'[&quot;839044ddd983c9a4adc6d6c2976542dc.jpg&quot;]',NULL,'',NULL,00000000145,00000000039,00000000001,1,'1647333790615563',NULL,0,0,0,0,NULL,'0',0),(87,'','',0,50,'','aa9058ec02611fa90a4f895715a15deb.jpg',0,6592,'','卫生间返味是我们日常生活经常会碰到的问题，通常遇到这种情况，大家都会喷上清香剂，其实这样治标不治本，每隔几天就又有味道了。那么针对卫生间返味我们应该从何下手呢？\n\n1、首先检查地漏，如果地漏反味，想想之前有没有安装存水弯，如果装了以后基本上可以杜绝返味，如果没有存水弯，那就在地漏下面装个“地漏宝”。\n\n2、如果地漏没问题，检查马桶，马桶排污管错位或底座密封圈老化，都会返味，甚至还有渗漏，如果是这种情况的话，只能重装。\n\n3、如果不是马桶的问题，检查洗手台和拖把池。洗手台的下水管是直接插入到管道中的，如果没有存水弯或者不是防臭的，就很可能就导致洗手台返味。所以要密封好下水管道连接处，用东西塞紧，或者有条件的可以做个简单的存水弯，防止气味上来，平时使用的时候用热水冲洗下水管，溶解管壁上的污渍。\n\n4、最后检查下排风口，要在排风口安装止逆阀，如果不装止逆阀，气味就会倒流，排风口就成了进风口。同时要观察排风管的大小是不是和与墙体开孔大小一样，如果孔大排风管细，就一定要注意密封好，别留空隙。\n\n#装修那些事# #头条家居# #卫生间返味#',0,'','1571018754','1571021010','',1,'','',275,'',2,'[&quot;056d7af9a6f0a0d4349944ab71dd0687.jpg&quot;,&quot;aa9058ec02611fa90a4f895715a15deb.jpg&quot;,&quot;dba8777c7df51b8475ed79ed13838d6a.jpg&quot;,&quot;d56eceee39f7666f10560503f6659481.jpg&quot;]',NULL,'',NULL,00000000418,00000000004,00000000000,1,'1647332560289806',NULL,0,0,0,0,NULL,'0',0),(88,'','',0,50,'','7c7a65e02fde3a79b1c6ec9bc6f62a8f.jpg',0,3672,'','#临汾头条##涨价# 说一说最近身边那些东西涨价了\n1、排名第一的猪肉大家都知道，涨得厉害\n2、山西人中午离不开的干面也涨了，一碗涨一元\n3、临汾特色名吃牛肉丸子面也涨了。\n4、临汾停车位\n5、临汾房价\n6、\n7、',0,'','1571017077','1571021017','',1,'','',276,'',2,'[&quot;6ab77d6aeda526ed7c9684a7483f15de.jpg&quot;,&quot;7c7a65e02fde3a79b1c6ec9bc6f62a8f.jpg&quot;,&quot;8fda8143266a47a74d6515815cf11cfa.jpg&quot;,&quot;ecba5f3f0e0976f2dbf76a9b33ab73fe.jpg&quot;,&quot;575979d867a7cf050958675f2f9e291a.jpg&quot;,&quot;a04a825c5048b9df28fc076117754bde.jpg&quot;]',NULL,'',NULL,00000000448,00000000037,00000000000,1,'1647330802254859',NULL,0,0,0,0,NULL,'0',0),(89,'','',0,50,'','35565c9b53772bdfce653170a8cd2c1b.jpg',0,808,'','#我的周末计划# 其实每个人包括你我都难免有无聊的时候，要真正摆脱无聊的烦恼，重新找回生活的精彩，你可以采取以下建议： 1，做自己喜欢做的事情，做自己擅长的事情，找回成功的喜悦，找回失去的信心，找到前进动力和方向； 2，心累了，人烦恼了就歇歇，让心灵去旅行，可以去爬山，看海，感受壮丽风光，拥抱自然，融入自然； 3，可以做喜欢的运动发泄一些，推荐跑步，散步和篮球。跑步可以锻炼身体，锻炼和提高人的意志和忍耐力；散步可以让人休闲，放松；篮球可以让人学会配合，增强团队意识和集体观念； 4，可以找知心朋友小聚，小酌几杯，向朋友倾诉，让温馨的友情驱散你内心的无聊，苦闷和孤独； 5，多和家人聊天，或者打电话，加强沟通，增进感情，告诉家人，我爱他们； 6，寻找知心恋人，让爱情升华你的情感，点缀你的生活，照亮你的灵魂； 7，如果有什么烦恼不方便和朋友，家人说的，可以上网于陌生人聊天，倾吐一下，也可以找到新的朋友； 8，在网上写日记，记下生活的点滴； 9，可以和三五知己逛街购物，说不定有意外的便宜货或者意外的美食在等着你，从中你可以收获意外的惊喜; 10，好好学习，找到学习的乐趣，不断进步，提高自己的学习成绩，结合自己的兴趣多看有关书籍，规划好自己的专业和就业道路，规划好自己的人生道路； 11，可以和家人适当地观看自己喜爱的电视剧，同时又可以和家人聊聊天，增进感情； 12，可以阅读自己感兴趣的书籍，开拓视野，增长见闻，丰富知识，为学习和工作打下良好的基础； 13，可以练练书法，画画，钢琴或者其它乐器，陶冶情操，增加气质； 14，提倡绿色上网，看看新闻，适当玩玩游戏，但是不是沉迷，这样可以打发时间； 15，适当地在家里做家务，这样既可以保持卫生，有可以得到家人的赞扬，可以得到生活的乐趣； 16，夕阳西下，来到野外寻找蒲公英，对着夕阳，迎着晚风轻轻一吹，那就是我飞扬的蒲公英',0,'','1571020272','1571021018','',1,'','',277,'',2,'[&quot;44e52487e0208af70c0ae89e02665d52.jpg&quot;,&quot;35565c9b53772bdfce653170a8cd2c1b.jpg&quot;]',NULL,'',NULL,00000000072,00000000030,00000000000,1,'1647334152305668',NULL,0,0,0,0,NULL,'0',0),(90,'','',0,50,'','790ea0ba9bfaccab41a0ed03e63ae8da.jpg',0,4223,'','2020年国家公务员专题已更新状态！\n公告预计将于今日14号公布！！！',0,'','1571017209','1571021019','',1,'','',278,'',2,'[&quot;68492c75cca263e884463058cb005e1b.jpg&quot;]',NULL,'',NULL,00000000381,00000000018,00000000000,1,'1647330941063179',NULL,0,0,0,0,NULL,'0',0),(91,'','',0,50,'','',0,5926,'','上了一定年纪的人都喜欢开始听老歌，因为他们都普遍怀旧，同样的老歌不同的人也可以唱出不同的韵味！https://m.toutiaoimg.com/group/6747469915453653516/?app=news_article&timestamp=1571019487&group_id=6747469915453653516',0,'','1571019666','1571021020','',1,'','',279,'',1,NULL,NULL,'',NULL,00000000573,00000000031,00000000000,1,'1647333516783619',NULL,0,0,0,0,NULL,'0',0),(92,'','',0,50,'','ab9ee0e589579871044e05d600c2b5d6.jpg',0,9529,'','#爱情语录#女孩在北京出差的时候，当兵的男孩刚好休假。\n\n他陪女孩出去吃了饭之后，回到酒店门口的时候，男孩说忘记买水果了，让女孩去买点。\n\n女孩买完水果回来，打开门，男孩手里拿着一枚戒指向女孩求婚，女孩被这突来的惊喜感动了。\n\n但她没有接受，从小父母离异的她并不相信婚姻，女孩父亲在她五岁时，跟别的女人跑了。\n\n母亲苦苦哀求也没有换回父亲的心，那时的她就发誓，这辈子都不结婚。\n\n直到当她遇到男孩后她以为自己已经跨过了这道心理障碍，她爱男孩，也相信男孩。\n\n可当她深爱的男孩单膝跪在面前时，她害怕了，女孩很纠结，只好说可不可以等她毕业后再说。\n\n男孩想说点什么，一个电话，男孩被叫回去出警了，女孩一个人在房间哭得稀里哗啦的。\n\n男孩一直忙到了凌晨4点才回来，女孩也一个晚上没睡。\n\n上天好像开始故意作弄他们，男孩被调去附近的城市，女孩只好在每个周末的时候去找男孩。\n\n房间里，男孩电话响了，女孩知道，男孩又要去出警了，女孩还是一晚没睡着。\n\n这一次天亮了男孩都没有回来，女孩打了男孩电话，一直没人接。\n\n直到中午，女孩接到了一个陌生电话，是男孩同事打过来的，说男孩被派去出差了，安排他来酒店送她去车站。\n\n她觉得有点奇一直追问，才知道昨晚男孩抓犯人时受伤了，现在在医院抢救。\n\n医院里，男孩刚刚被推出手术室，女孩一直陪在男孩身边，她不知道男孩是否还会再醒过来…\n#情感#',0,'','1570973476','1571021022','',1,'','',280,'',2,'[&quot;8039fc0a3fe3e3dfb3aaf1893893801c.jpg&quot;]',NULL,'',NULL,00000000543,00000000042,00000000000,1,'1647285082977283',NULL,0,0,0,0,NULL,'0',0),(93,'','',0,50,'','b64cd5e4f67d075eeb034b2e60558bcf.jpg',0,7228,'','皮鞋发霉了怎么办？小妹教你这几招\n每个上班族都离不开皮鞋，尤其是男性，皮鞋不止一双，所以有时候长期不穿，或者下雨淋湿之后，应当及时处理，比如洗刷之后晒干，或者经常晒晒自己的皮鞋，就不会发霉了。如果没有及时处理的话，很容易就会发霉，那么皮鞋发霉怎么处理呢？\n\n1、正确的清洗\n可以先用温湿的干净布条擦拭皮鞋发霉的地方，然后再使用干净的干布再次擦拭皮鞋。把报纸揉成团团，然后塞进皮鞋里，放到通风口，隔一天再给皮鞋涂上鞋油，这样皮鞋的霉味就能去掉了。但是严禁用水直接冲洗皮鞋，这样会让皮鞋坏的更快的，会让皮鞋开口笑，甚至皮鞋面部会起泡!\n\n2、深浅色皮鞋发霉处理\n用软头的洗毛刷把皮鞋表面的发霉物质刷掉，用符合鞋面颜色的鞋油把皮鞋擦拭一遍，比如黑色皮鞋用黑鞋油，然后用干净的绒布把皮鞋的表面擦亮就可以了。\n\n3、浅色皮鞋发霉之后的处理\n如果你的鞋子是白色或者浅灰色的话，可以先用细毛刷轻轻的把发霉物质刷掉，然后用去油渍的东西将鞋面的赃物擦拭一下，如果还没有清除鞋上的发霉物质，使用甲苯来擦一下试试，直到擦拭干净为止。在用白色或者透明的皮鞋乳胶将皮鞋表面完整的擦拭一遍，最后用绒布将鞋面轻轻擦亮为止。\n\n4、被雨水淋湿而发霉\n淋雨之后皮鞋湿透了，不要脱下来就直接扔在鞋架上，那样皮鞋会变形发霉。先用吸水的布料把皮鞋表面的水分洗掉，然后用力擦拭皮鞋，往鞋内塞卫生纸团或者报纸团。湿了以后再次更换，直到皮鞋上的水被吸干，干到一定的程度的时候，记得把鞋型塞进鞋里，这样可以避免皮鞋发霉，还可以防止皮鞋变形。\n',0,'','1571019919','1571021024','',1,'','',281,'',2,'[&quot;4e2666fcc1b7576a08999b8edd2a8cfa.jpg&quot;,&quot;b64cd5e4f67d075eeb034b2e60558bcf.jpg&quot;,&quot;07f22755a10f2a19d36ccbf2f7638049.jpg&quot;,&quot;2d6a11d036b3387aef0f1d4a7ffd7a22.jpg&quot;]',NULL,'',NULL,00000000438,00000000013,00000000000,1,'1647333782855684',NULL,0,0,0,0,NULL,'0',0),(94,'','',0,50,'','9818289b4722eea84499795e4e8a5d35.jpg',0,9729,'','我是貔貅吗？我是貔貅他妈给貔貅开门，貔貅到家了。\n\n我老公是那种憨厚孝顺型，对他爸妈的，几乎是有求必应。达到家具，小到一瓶酱油，每次回家都会带。\n\n我感觉老公做的有点过火了。爸妈身体都还好，生活自理完全没问题，定期回家看看也就行了，完全没必要这样。\n\n于是他再找我要钱时，我就推三阻四，有几次直接没给。他还有点不乐意了。\n\n后来我们买了车，每次回家，也给他爸妈买衣服，包括老公的，捯饬的也精神多。\n\n后来老公也不再说啥了，只有一句：钱进你兜里，想逃出来真难。\n\n难道我做得不对吗？#我要上头条# #当代人的爱情焦虑#',0,'','1571018875','1571021025','',1,'','',282,'',2,'[&quot;c445ea394defc481893005c007735869.jpg&quot;]',NULL,'',NULL,00000000198,00000000008,00000000000,1,'1647332687794179',NULL,0,0,0,0,NULL,'0',0),(95,'','',0,50,'','3de30559c0ebd9384dd874a7113ade5b.jpg',0,2248,'','#吃在中国# #西蓝花# 【美食分享】\n杏鲍菇拼西蓝花\n主料:西蓝花1个，杏鲍菇2根。\n辅料:盐2克，鸡精2克，蚝油1勺，生抽1勺，花生油60克。\n步骤一:西蓝花切成小朵，洗净备用。\n步骤二:锅内烧开水，加几滴油，盐，鸡精，下西蓝花煮一下变软。\n步骤三:煮好的西蓝花盛出，均匀的摆入盘子。\n步骤四:杏鲍菇洗净后切片。\n步骤五:锅内热油，下杏鲍菇炒至变软。\n步骤六:再调入生抽，蚝油，鸡精炒入味上色。\n步骤七:将炒好的杏鲍菇盛出，装入盘子中间。就成功了。',0,'','1571020038','1571021027','',1,'','',283,'',2,'[&quot;b028cc663cdef8572c266135887d42d4.jpg&quot;,&quot;3de30559c0ebd9384dd874a7113ade5b.jpg&quot;,&quot;b2e37336ca38e7da0144c232657c4162.jpg&quot;]',NULL,'',NULL,00000000578,00000000007,00000000000,1,'1647333907591180',NULL,0,0,0,0,NULL,'0',0),(96,'','',0,50,'','3c6f00c23f94c6fdde4898c052a8876f.jpg',0,9326,'','秋天到了，天气渐渐转凉，好多小仙女是不是又在发愁衣柜里没有衣服穿[奸笑][奸笑][奸笑][奸笑][奸笑]\n今天就来和大家介绍一下穿搭\n秋天必不可少的肯定就是卫衣了，卫衣的实用性还是很强的\n首先卫衣最常见的搭配就是牛仔裤，一件宽松的卫衣搭配上高腰牛仔裤，可以拉长整体的身材比例，足足的小仙女一枚\n然后卫衣还可以搭配一条短裤，配上过膝靴，营造一种下半身失踪的感觉，妥妥的大长腿立现\n好了，今天就先说这么多，小仙女们还想知道什么，欢迎在底下留言哦',0,'','1571019458','1571021028','',1,'','',284,'',2,'[&quot;50560a043d17d8f37c963e769b9272a2.jpg&quot;,&quot;3c6f00c23f94c6fdde4898c052a8876f.jpg&quot;]',NULL,'',NULL,00000000374,00000000049,00000000000,1,'1647333299409934',NULL,0,0,0,0,NULL,'0',0),(97,'','',0,50,'','1a6259914c72340b3ce1b3f30744545d.jpg',0,5945,'','秋冬吃萝卜好处多但食用禁忌不可不知\n俗话说：“冬吃萝卜夏吃姜，不劳医师开药方”。萝卜素有“平民人参”的美誉，冬天吃萝卜有助于疏散脏腑的阳热，透过萝卜行气的功效，让内部的阳热疏散一部分到体表之外，帮助抵御寒冷。\n虽然吃萝卜好处多多，但如果吃得方法不对，则会对身体会造成负面影响。\n1、不能和胡萝卜一起吃\n这两种萝卜本身对人体都有很大的好处，可是放在一起吃就等于完全无效！主要是因为胡萝卜中含有一种叫抗坏血酸的解酵素，会破坏白萝卜中的维生素C，营养价值大打折扣。\n2、不能与橘子一起吃\n当萝卜摄入人体后，可迅速产生一种叫硫氰酸盐的物质。橘子中的类黄酮物质在肠道转化成羟苯甲酸及阿魏酸，与硫氰酸盐作用加强后会成为硫氰酸。\n硫氰酸有抑制甲状腺的作用，从而诱发或导致甲状腺肿。柿子、梨、苹果、葡萄等水果都含有大量的植物色素，所以吃了萝卜后，短时间内不要再吃这些水果。\n3、不能与人参一起吃\n服用人参大补元气，若同时吃萝卜却是破气。这一补一破，人参就起不到滋补作用了。同时，萝卜有利尿消食作用，吃了萝卜，会将人参有效成分从尿中流失，影响对人参的吸收。',0,'','1571019247','1571021047','',1,'','',285,'',2,'[&quot;4e2ed258460432d882e2f4e629252a5b.jpg&quot;,&quot;1a6259914c72340b3ce1b3f30744545d.jpg&quot;]',NULL,'',NULL,00000000473,00000000024,00000000000,1,'1647333078251527',NULL,0,0,0,0,NULL,'0',0),(98,'','',0,50,'','53dd65bf3cfa3aacab2fbcb1b74eb2d9.jpg',0,2364,'','欧楷的竖钩是如何一笔写出来的？看了老师的详细讲解会让你立马领悟，其实就是这么简单，视频所用毛笔点击下面链接即可，现在购买送练字毛毡一张！侯保成书法课堂的视频\n欧楷专用兼毫笔\n欧楷专用兼毫笔',0,'','1571012611','1571021051','',1,'','',286,'',2,'[&quot;cb5ba63905f54ef4505eb2392ffebb3a.jpg&quot;,&quot;53dd65bf3cfa3aacab2fbcb1b74eb2d9.jpg&quot;,&quot;53793b4b8f7427867ca8eee5e8b3037b.jpg&quot;,&quot;d22fbf7bbf299746f13063f3f50d243f.jpg&quot;]',NULL,'',NULL,00000000130,00000000018,00000000000,1,'1647326118913036',NULL,0,0,0,0,NULL,'0',0);
