INSERT INTO `fx_page` VALUES (1,'关于我们','',50),(2,'隐私条款','<p>用户协议及隐私条款</p><p><br/></p><p><br/></p><p><br/></p><p>一、账号注册</p><p><br/></p><p>用户在使用本服务前需要注册一个“皮一波”账号。“皮一波”账号应当使用邮箱、微信号、手机号码中绑定注册，请用户使用尚未与“皮一波”账号绑定的邮箱、微信号、手机号码，以及未被皮一波根据本协议封禁的邮箱、微信号、手机号码注册“皮一波”账号。皮一波可以根据用户需求或产品需要对账号注册和绑定的方式进行变更，而无须事先通知用户。</p><p><br/></p><p>在用户注册及使用本服务时，皮一波需要搜集能识别用户身份的个人信息以便皮一波可以在必要时联系用户，或为用户提供更好的使用体验。皮一波搜集的信息包括但不限于用户的姓名、性别、年龄、出生日期、身份证号、地址、学校情况、公司情况、所属行业、兴趣爱好、常出没的地方、个人说明；皮一波同意对这些信息的使用将受限于第三条用户个人隐私信息保护的约束。</p><p><br/></p><p>二、服务内容</p><p><br/></p><p>本服务的具体内容由皮一波根据实际情况提供，包括但不限于授权用户通过其账号进行即时通讯、添加好友、加入群组、关注他人、发布留言。皮一波可以对其提供的服务予以变更，且皮一波提供的服务内容可能随时变更；用户将会收到皮一波关于服务变更的通知。</p><p><br/></p><p>皮一波提供的服务包含免费服务与收费服务。用户可以通过付费方式购买收费服务，具体方式为：用户通过网上银行、支付宝或其他“皮一波”平台提供的付费途径支付一定数额的人民币购买“皮一波”收费会员资格，从而获得收费会员享有的权限。用户确认，除法律法规明确规定外，收费会员资格一旦购买成功，不能转让他人，皮一波不予退款。</p><p><br/></p><p>对于收费服务，皮一波会在用户使用之前给予用户明确的提示，只有用户根据提示确认其同意按照前述支付方式支付费用并完成了支付行为，用户才能使用该等收费服务。支付行为的完成以银行或第三方支付平台生成“支付已完成”的确认通知为准。</p><p><br/></p><p>三、用户个人隐私信息保护</p><p><br/></p><p>用户在注册账号或使用本服务的过程中，可能需要填写或提交一些必要的信息，如法律法规、规章规范性文件（以下称“法律法规”）规定的需要填写的身份信息。如用户提交的信息不完整或不符合法律法规的规定，则用户可能无法使用本服务或在使用本服务的过程中受到限制。</p><p><br/></p><p>个人隐私信息是指涉及用户个人身份或个人隐私的信息，比如，用户真实姓名、身份证号、手机号码、手机设备识别码、微信号、IP地址、用户聊天记录。非个人隐私信息是指用户对本服务的操作状态以及使用习惯等明确且客观反映在皮一波服务器端的基本记录信息、个人隐私信息范围外的其它普通信息，以及用户同意公开的上述隐私信息。</p><p><br/></p><p>尊重用户个人隐私信息的私有性是皮一波的一贯制度，皮一波将采取技术措施和其他必要措施，确保用户个人隐私信息安全，防止在本服务中收集的用户个人隐私信息泄露、毁损或丢失。在发生前述情形或者皮一波发现存在发生前述情形的可能时，将及时采取补救措施。</p><p><br/></p><p>皮一波未经用户同意不向任何第三方公开、 透露用户个人隐私信息。但以下特定情形除外：</p><p><br/></p><p>皮一波根据法律法规规定或有权机关的指示提供用户的个人隐私信息；</p><p><br/></p><p>由于用户将其用户密码告知他人或与他人共享注册帐户与密码，由此导致的任何个人信息的泄漏，或其他非因皮一波原因导致的个人隐私信息的泄露；</p><p><br/></p><p>用户自行向第三方公开其个人隐私信息；</p><p><br/></p><p>用户与皮一波及合作单位之间就用户个人隐私信息的使用公开达成约定，皮一波因此向合作单位公开用户个人隐私信息；</p><p><br/></p><p>任何由于黑客攻击、电脑病毒侵入及其他不可抗力事件导致用户个人隐私信息的泄露。</p><p><br/></p><p>用户同意皮一波可在以下事项中使用用户的个人隐私信息：</p><p><br/></p><p>皮一波向用户及时发送重要通知，如软件更新、本协议条款的变更；</p><p><br/></p><p>皮一波内部进行审计、数据分析和研究等，以改进皮一波的产品、服务和与用户之间的沟通；</p><p><br/></p><p>依本协议约定，皮一波管理、审查用户信息及进行处理措施；</p><p><br/></p><p>适用法律法规规定的其他事项。</p><p><br/></p><p>除上述事项外，如未取得用户事先同意，皮一波不会将用户个人隐私信息使用于任何其他用途。</p><p><br/></p><p>皮一波重视对未成年人个人隐私信息的保护。皮一波将依赖用户提供的个人信息判断用户是否为未成年人。任何18岁以下的未成年人注册账号或使用本服务应事先取得家长或其法定监护人（以下简称&quot;监护人&quot;）的书面同意。除根据法律法规的规定及有权机关的指示披露外，皮一波不会使用或向任何第三方透露未成年人的聊天记录及其他个人隐私信息。</p><p><br/></p><p>为了改善皮一波的技术和服务，向用户提供更好的服务体验，皮一波或可会自行收集使用或向第三方提供用户的非个人隐私信息。</p><p><br/></p><p>四、内容规范</p><p><br/></p><p>本条所述内容是指用户使用本服务过程中所制作、上载、复制、发布、传播的任何内容，包括但不限于账号头像、名称、用户说明等注册信息及认证资料，或文字、语音、图片、视频、图文等发送、回复或自动回复消息和相关链接页面，以及其他使用账号或本服务所产生的内容。</p><p><br/></p><p>皮一波提供的服务包含免费服务与收费服务。用户可以通过付费方式购买收费服务，具体方式为：用户通过网上银行、支付宝或其他“皮一波”平台提供的付费途径支付一定数额的人民币购买“皮一波”收费会员资格，从而获得收费会员享有的权限。用户确认，除法律法规明确规定外，收费会员资格一旦购买成功，不能转让他人，皮一波不予退款。</p><p><br/></p><p>反对宪法所确定的基本原则的；</p><p><br/></p><p>危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p><p><br/></p><p>损害国家荣誉和利益的；</p><p><br/></p><p>煽动民族仇恨、民族歧视，破坏民族团结的；</p><p><br/></p><p>破坏国家宗教政策，宣扬邪教和封建迷信的；</p><p><br/></p><p>散布谣言，扰乱社会秩序，破坏社会稳定的；</p><p><br/></p><p>散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p><p><br/></p><p>侮辱或者诽谤他人，侵害他人合法权益的；</p><p><br/></p><p>不遵守法律法规底线、社会主义制度底线、国家利益底线、公民合法权益底线、社会公共秩序底线、道德风尚底线和信息真实性底线的“七条底线”要求的；</p><p><br/></p><p>含有法律、行政法规禁止的其他内容的信息。</p><p><br/></p><p>用户不得利用“皮一波”账号或本服务制作、上载、复制、发布、传播如下干扰“皮一波”正常运营，以及侵犯其他用户或第三方合法权益的内容：</p><p><br/></p><p>含有任何性或性暗示的；</p><p><br/></p><p>含有辱骂、恐吓、威胁内容的；</p><p><br/></p><p>含有骚扰、垃圾广告、恶意信息、诱骗信息的；</p><p><br/></p><p>涉及他人隐私、个人信息或资料的；</p><p><br/></p><p>侵害他人名誉权、肖像权、知识产权、商业秘密等合法权利的；</p><p><br/></p><p>含有其他干扰本服务正常运营和侵犯其他用户或第三方合法权益内容的信息。</p><p><br/></p><p>五、使用规则</p><p><br/></p><p>用户在本服务中或通过本服务所传送、发布的任何内容并不反映或代表，也不得被视为反映或代表皮一波的观点、立场或政策，皮一波对此不承担任何责任。</p><p><br/></p><p>用户不得利用“皮一波”账号或本服务进行如下行为：</p><p><br/></p><p>提交、发布虚假信息，或盗用他人头像或资料，冒充、利用他人名义的；</p><p><br/></p><p>强制、诱导其他用户关注、点击链接页面或分享信息的；</p><p><br/></p><p>虚构事实、隐瞒真相以误导、欺骗他人的；</p><p><br/></p><p>利用技术手段批量建立虚假账号的；</p><p><br/></p><p>利用“皮一波”账号或本服务从事任何违法犯罪活动的；</p><p><br/></p><p>制作、发布与以上行为相关的方法、工具，或对此类方法、工具进行运营或传播，无论这些行为是否为商业目的；</p><p><br/></p><p>其他违反法律法规规定、侵犯其他用户合法权益、干扰“皮一波”正常运营或皮一波未明示授权的行为。</p><p><br/></p><p>用户须对利用“皮一波”账号或本服务传送信息的真实性、合法性、无害性、准确性、有效性等全权负责，与用户所传播的信息相关的任何法律责任由用户自行承担，与皮一波无关。如因此给皮一波或第三方造成损害的，用户应当依法予以赔偿。</p><p><br/></p><p>皮一波提供的服务中可能包括广告，用户同意在使用过程中显示皮一波和第三方供应商、合作伙伴提供的广告。除法律法规明确规定外，用户应自行对依该广告信息进行的交易负责，对用户因依该广告信息进行的交易或前述广告商提供的内容而遭受的损失或损害，皮一波不承担任何责任。</p><p><br/></p><p>六、帐户管理</p><p><br/></p><p>“皮一波”账号的所有权归皮一波所有，用户完成申请注册手续后，获得“皮一波”账号的使用权，该使用权仅属于初始申请注册人，禁止赠与、借用、租用、转让或售卖。皮一波因经营需要，有权回收用户的“皮一波”账号。</p><p><br/></p><p>用户可以更改、删除“皮一波”帐户上的个人资料、注册信息及传送内容等，但需注意，删除有关信息的同时也会删除用户储存在系统中的文字和图片。用户需承担该风险。</p><p><br/></p><p>用户有责任妥善保管注册账号信息及账号密码的安全，因用户保管不善可能导致遭受盗号或密码失窃，责任由用户自行承担。用户需要对注册账号以及密码下的行为承担法律责任。用户同意在任何情况下不使用其他用户的账号或密码。在用户怀疑他人使用其账号或密码时，用户同意立即通知皮一波。</p><p><br/></p><p>用户应遵守本协议的各项条款，正确、适当地使用本服务，如因用户违反本协议中的任何条款，皮一波在通知用户后有权依据协议中断或终止对违约用户“皮一波”账号提供服务。同时，皮一波保留在任何时候收回“皮一波”账号、用户名的权利。</p><p><br/></p><p>如用户注册“皮一波”账号后一年不登录，通知用户后，皮一波可以收回该账号，以免造成资源浪费，由此造成的不利后果由用户自行承担。</p><p><br/></p><p>七、数据储存</p><p><br/></p><p>皮一波不对用户在本服务中相关数据的删除或储存失败负责。</p><p><br/></p><p>皮一波可以根据实际情况自行决定用户在本服务中数据的最长储存期限，并在服务器上为其分配数据最大存储空间等。用户可根据自己的需要自行备份本服务中的相关数据。</p><p><br/></p><p>如用户停止使用本服务或本服务终止，皮一波可以从服务器上永久地删除用户的数据。本服务停止、终止后，皮一波没有义务向用户返还任何数据。</p><p><br/></p><p>八、风险承担</p><p><br/></p><p>用户理解并同意，“皮一波”仅为用户提供信息分享、传送及获取的平台，用户必须为自己注册账号下的一切行为负责，包括用户所传送的任何内容以及由此产生的任何后果。用户应对“皮一波”及本服务中的内容自行加以判断，并承担因使用内容而引起的所有风险，包括因对内容的正确性、完整性或实用性的依赖而产生的风险。皮一波无法且不会对因用户行为而导致的任何损失或损害承担责任。&nbsp;</p><p><br/></p><p>如果用户发现任何人违反本协议约定或以其他不当的方式使用本服务，请立即向皮一波举报或投诉，皮一波将依本协议约定进行处理。</p><p><br/></p><p>用户理解并同意，因业务发展需要，皮一波保留单方面对本服务的全部或部分服务内容变更、暂停、终止或撤销的权利，用户需承担此风险。</p><p><br/></p><p>九、知识产权声明</p><p><br/></p><p>除本服务中涉及广告的知识产权由相应广告商享有外，皮一波在本服务中提供的内容（包括但不限于网页、文字、图片、音频、视频、图表等）的知识产权均归皮一波所有，但用户在使用本服务前对自己发布的内容已合法取得知识产权的除外。</p><p><br/></p><p>除另有特别声明外，皮一波提供本服务时所依托软件的著作权、专利权及其他知识产权均归皮一波所有。</p><p><br/></p><p>皮一波在本服务中所涉及的图形、文字或其组成，以及其他皮一波标志及产品、服务名称（以下统称“皮一波标识”），其著作权或商标权归皮一波所有。未经皮一波事先书面同意，用户不得将皮一波标识以任何方式展示或使用或作其他处理，也不得向他人表明用户有权展示、使用、或其他有权处理皮一波标识的行为。</p><p><br/></p><p>上述及其他任何皮一波或相关广告商依法拥有的知识产权均受到法律保护，未经皮一波或相关广告商书面许可，用户不得以任何形式进行使用或创造相关衍生作品。</p><p><br/></p><p>十、法律责任</p><p><br/></p><p>如果皮一波发现或收到他人举报或投诉用户违反本协议约定的，皮一波有权