务，而无需对用户或任何第三方承担任何责任：</p><p><br/></p><p>根据法律规定用户应提交真实信息，而用户提供的个人资料不真实、或与注册时信息不一致又未能提供合理证明；</p><p><br/></p><p>用户违反相关法律法规或本协议的约定；</p><p><br/></p><p>按照法律规定或有权机关的要求；</p><p><br/></p><p>于安全的原因或其他必要的情形。</p><p><br/></p><p>十三、其他</p><p><br/></p><p>皮一波郑重提醒用户注意本协议中免除皮一波责任和限制用户权利的条款，请用户仔细阅读，自主考虑风险。未成年人应在法定监护人的陪同下阅读本协议。</p><p><br/></p><p>本协议的效力、解释及纠纷的解决，适用于中华人民共和国法律。若用户和皮一波之间发生任何纠纷或争议，首先应友好协商解决，协商不成的，用户同意将纠纷或争议提交皮一波住所地有管辖权的人民法院管辖。</p><p><br/></p><p>本协议的任何条款无论因何种原因无效或不具可执行性，其余条款仍有效，对双方具有约束力。</p><p><br/></p>',50),(3,'如何收徒','<p style=\"text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">分享您的推广链接给好友即可完成收徒任务哦。</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">每收一名徒弟奖励0.5零钱+2000金币。</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(255, 0, 0);\">您收的徒弟阅读文章您均有永久提成。</span></p>',50),(4,'奖励规则','<p><span style=\"color: rgb(255, 0, 0);\">1：获得2级徒弟阅读文章金币收益提成。</span></p><p><span style=\"color: rgb(255, 0, 0);\">2：获得2级徒弟发布内涵金币收益提成。</span></p><p><span style=\"color: rgb(255, 0, 0);\">3：获得2级徒弟每天登陆app零钱收益提成。</span></p><p><span style=\"color: rgb(255, 0, 0);\">4：您邀请的好友如果也邀请了徒弟，那么您同样有零钱收益以及金币阅读收益提成。</span><br/></p>',50),(5,'如何赚钱','<p><span style=\"color: rgb(42, 42, 42); font-family: &quot;Microsoft Yahei&quot;, Helvetica, Arial, sans-serif; text-align: justify; text-indent: 32px; background-color: rgb(255, 255, 255);\">皮一波是国内优秀的福利线报app软件，涵盖最新的全网福利活动，您通过浏览活动文章即可赚取金币，金币可通过商城兑换商品或转换零钱提现。</span></p>',50);
