INSERT INTO `fx_temp` VALUES ('switch','开放会员注册','取消打勾无法进去会员','1'),('logincode','登录开启验证码','开放验证码增加安全性','1'),('regcode','注册开启验证码','注册验证码可增强安全性','1'),('ip','限制IP注册数量','限制IP注册，一个IP每天注册对用数量，0表示不限制','6'),('audit','手动审核会员注册','开启审核后，会员注册必须通过管理员审核才能登录','1'),('pwdcode','密码找回开启验证码','','1'),('jingyan','注册赠送账户经验值','填写经验值数字，注册会员则自动赠送对应的经验值账户','33'),('score','注册赠送账户积分','填写积分数字，注册会员则自动赠送对应的积分到账户','22'),('money','注册赠送账户余额','填写余额数字，注册会员则自动赠送对应的余额到账户','11'),('ban','禁止账户注册','多个禁止账户请用逗号 ， 进行分割','admin,123456,ffxiang'),('regmobile','开放手机注册','','1'),('regemail','开放邮箱注册','','1'),('reguser','开放用户名注册','','1'),('articleAdd','文章投稿','高于经验值的会员开放文章投稿','3'),('articleHide','投稿审核','小于经验值的会员开启审核文章','6'),('articleScore','投稿奖励积分','0表示不奖励，投稿文章审核通过后自动给投稿会员奖励积分','10'),('articleNum','每天投稿限制','每个会员投稿限制文章，防止会员无限投稿文章','10'),('articleCode','投稿文章开启验证码','防止会员无限制投稿文章，有利于安全','1'),('articleJingyan','投稿奖励经验值','用户投稿审核通过后自动增加经验值，经验值提高会员等级','10'),('articleMoney','投稿奖励金额','投稿审核通过后自动奖励金额，金额相当于人民币','2');
