CREATE TABLE `fx_typeid` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tid` int(11) NOT NULL COMMENT '关联ID',
  `title` varchar(255) NOT NULL COMMENT '栏目标题',
  `keywords` varchar(255) NOT NULL COMMENT '关键词',
  `description` varchar(255) NOT NULL COMMENT '描述',
  `image` varchar(255) NOT NULL COMMENT '缩略图或图片',
  `des` int(5) NOT NULL COMMENT '排序',
  `hide` int(2) NOT NULL COMMENT '0隐藏 1显示',
  `url` varchar(255) NOT NULL COMMENT '跳转连接',
  `template_index` varchar(100) NOT NULL COMMENT '封面频道',
  `template_list` varchar(100) NOT NULL COMMENT '列表文件',
  `template_view` varchar(100) NOT NULL COMMENT '内容文件',
  `content` text NOT NULL COMMENT '内容',
  `click` int(11) unsigned zerofill NOT NULL COMMENT '栏目点击统计次数',
  `faved` int(11) NOT NULL COMMENT '贴吧关注人数',
  `isdefault` int(10) unsigned zerofill DEFAULT NULL COMMENT '频道设置  1封面 2列表 3单页',
  `create_time` int(11) NOT NULL COMMENT '创建日期',
  `update_time` int(11) NOT NULL COMMENT '更新日期',
  `mychannel_article` int(11) unsigned zerofill NOT NULL COMMENT '频道模型',
  `mychannel_video` int(11) NOT NULL,
  `mychannel_images` int(11) NOT NULL,
  `toutiao_name` varchar(255) DEFAULT NULL COMMENT '头条分类（采集data-category关联）',
  `uid` int(11) NOT NULL COMMENT '用户id',
  `bazhu_id` int(11) NOT NULL DEFAULT '0' COMMENT '吧主id',
  `is_tuijian` tinyint(1) NOT NULL DEFAULT '0',
  `article_num` int(11) NOT NULL COMMENT '文章数量',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `bazhu_id` (`bazhu_id`),
  KEY `is_tuijian` (`is_tuijian`)
) ENGINE=MyISAM AUTO_INCREMENT=211 DEFAULT CHARSET=utf8 COMMENT='采集分类http://www.toutiao.com/articles_news_society/';
